import ExpenseItem from "./ExpenseItem";
import './Expense.css';
export default function Expense(pro){
    
    return(
        <div className="expenses ">
        <ExpenseItem title={pro.item.expenses[0].title} amount={pro.item.expenses[0].amount} date={pro.item.expenses[0].date}></ExpenseItem>
        <ExpenseItem title={pro.item.expenses[1].title} amount={pro.item.expenses[1].amount} date={pro.item.expenses[1].date}></ExpenseItem>
        <ExpenseItem title={pro.item.expenses[2].title} amount={pro.item.expenses[2].amount} date={pro.item.expenses[2].date}></ExpenseItem>
        <ExpenseItem title={pro.item.expenses[3].title} amount={pro.item.expenses[3].amount} date={pro.item.expenses[3].date}></ExpenseItem>
        </div>
    );
}
